end
function imgui.CreatePadding(padding_custom,padding_custom2)
	padding_custom, padding_custom2 = padding_custom or 8, padding_custom2 or 8
	imgui.CreatePaddingX(padding_custom)
	imgui.CreatePaddingY(padding_custom2)
end

function mimgui.CustomCheckbox(boxText, arg)
	if arg[0] == false then
		imgui.PushStyleColor(imgui.Col.FrameBg, imgui.ImVec4(1.0, 1.0, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.FrameBgHovered, imgui.ImVec4(1.0, 1.0, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.CheckMark, imgui.ImVec4(1.0, 1.0, 1.0, 0.0))
	else
		imgui.PushStyleColor(imgui.Col.FrameBg, imgui.ImVec4(0.8, 0.38, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.FrameBgHovered, imgui.ImVec4(0.8, 0.38, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.CheckMark, imgui.ImVec4(0.8, 0.38, 1.0, 0.0))
	end
	local result = imgui.Checkbox(boxText, arg)
	imgui.PopStyleColor(3)
    return result
end

function mimgui.CustomToggleButton(buttonID, buttonTitle, arg)
	if arg[0] == false then
		imgui.PushStyleColor(imgui.Col.FrameBgHovered, imgui.ImVec4(1.0, 1.0, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.ButtonActive, imgui.ImVec4(1.0, 1.0, 1.0, 1.00))
	else
		imgui.PushStyleColor(imgui.Col.FrameBgHovered, imgui.ImVec4(0.8, 0.38, 1.0, 1.0))
		imgui.PushStyleColor(imgui.Col.ButtonActive, imgui.ImVec4(0.8, 0.38, 1.0, 1.00))
	end
    imgui.PushFont(ToggleButtonTitleFont)
        imgui.TextColoredRGB(buttonTitle)
    imgui.PopFont()
    imgui.SameLine(nil, 5)
	local result = mimgui.ToggleButton(buttonID, arg)
	imgui.PopStyleColor(2)
    return result
end

function mimgui.CustomButton(unicalID, buttonText, buttonSize)
	imgui.PushStyleVarVec2(imgui.StyleVar.WindowPadding, imgui.ImVec2(0.0, 0.0))
	imgui.PushStyleVarFloat(imgui.StyleVar.WindowBorderSize, 3.0)
	imgui.BeginChild(unicalID, imgui.ImVec2(130, 30), true)
    imgui.PushStyleColor(imgui.Col.Button, imgui.ImVec4(0.0, 0.0, 0.0, 0.0))
    imgui.PushStyleColor(imgui.Col.ButtonHovered, imgui.ImVec4(0.0, 0.0, 0.0, 0.3))
    imgui.PushStyleColor(imgui.Col.ButtonActive, imgui.ImVec4(0.0, 0.0, 0.0, 0.3))
    local result = imgui.Button(u8(buttonText), buttonSize)
    imgui.PopStyleColor(3)
	imgui.EndChild()
	imgui.PopStyleVar(2)
    return result
