function main()
    if not isSampLoaded() or not isSampfuncsLoaded() then return end
    while not isSampAvailable() do wait(100) end

    if not doesDirectoryExist(getWorkingDirectory()..'/config/Hitman Helper') then createDirectory(getWorkingDirectory()..'/config/Hitman Helper') end
    if not doesFileExist(getWorkingDirectory()..'/config/Hitman Helper/hh_config.ini') then io.open(getWorkingDirectory()..'/config/Hitman Helper/hh_config.ini', 'w+'):close() end

    config_path = getWorkingDirectory()..'/config/Hitman Helper/hh_config.ini'
    weaponslist_path = getWorkingDirectory()..'/config/Hitman Helper/weapons_list.txt'
    mainIni = inicfg.load(defaultIni, config_path)

    cb_stypemodule = new.bool(mainIni.config.screen_type)
    cb_stypemacross = new.bool(not mainIni.config.screen_type)
    cb_otsauto = new.bool(mainIni.config.otstrel_type)
    cb_otslocal = new.bool(not mainIni.config.otstrel_type)
    
    cb_autoscreen = new.bool(mainIni.config.autoscreen)
    cb_wscreen = new.bool(mainIni.config.without_screen)
    
    cb_hud = new.bool(mainIni.config.hud)
    cb_sspeed = new.bool(mainIni.config.s_speed)
    
    cb_chat_misli = new.bool(mainIni.chat.misli)
    cb_chat_padm = new.bool(mainIni.chat.p_adm)
    cb_chat_frac = new.bool(mainIni.chat.frac)
    cb_chat_fam = new.bool(mainIni.chat.fam)
    cb_chat_ads = new.bool(mainIni.chat.ads)
    cb_chat_invites = new.bool(mainIni.chat.invites)
    cb_chat_gos_ads = new.bool(mainIni.chat.gos_ads)
    cb_chat_a_adm = new.bool(mainIni.chat.a_adm)
    cb_chat_ncnn = new.bool(mainIni.chat.news_cnn)
    cb_chat_nsekta = new.bool(mainIni.chat.news_sekta)
    cb_chat_hads = new.bool(mainIni.chat.hit_ads)
    cb_chat_propose = new.bool(mainIni.chat.propose)
    
    cb_ooconly = new.bool(mainIni.config.ooc_only)
    cb_customctstr = new.bool(mainIni.config.customctstr)
    cb_customid = new.bool(mainIni.config.customid)
    cb_automobile = new.bool(mainIni.config.automobile)
    cb_autofill = new.bool(mainIni.config.autofill)
    cb_cstream = new.bool(mainIni.config.cstream)
    cb_otstrel = new.bool(mainIni.config.otstrel)
    cb_metka = new.bool(mainIni.config.metka)
    cb_autofind = new.bool(mainIni.config.autofind)

    if not doesFileExist(getFolderPath(0x14)..'/10089.ttf') or not doesFileExist(getFolderPath(0x14)..'/BAHNSCHRIFT.ttf') or not doesFileExist(getFolderPath(0x14)..'/12002.ttf') then
        downloadUrlToFile('https://github.com/moreveal/moreveal_hh/blob/main/fonts/10089.TTF?raw=true', getFolderPath(0x14)..'/10089.ttf', function(id, status) end)
        wait(1000)
        downloadUrlToFile('https://github.com/moreveal/moreveal_hh/blob/main/fonts/BAHNSCHRIFT.TTF?raw=true', getFolderPath(0x14)..'/BAHNSCHRIFT.ttf', function(id, status) end)
        wait(1000)
        downloadUrlToFile('https://github.com/moreveal/moreveal_hh/blob/main/fonts/12002.ttf?raw=true', getFolderPath(0x14)..'/12002.ttf', function(id, status) end)
        wait(1000)
    end
    if not doesFileExist(getWorkingDirectory()..'/lib/screenshot.lua') or not doesFileExist(getGameDirectory()..'/Screenshot.asi') then
        downloadUrlToFile('https://raw.githubusercontent.com/moreveal/moreveal_hh/main/lib/screenshot/screenshot.lua', getWorkingDirectory()..'/lib/screenshot.lua', function(id, status) end)
        downloadUrlToFile('https://github.com/moreveal/moreveal_hh/raw/main/lib/screenshot/Screenshot.asi', getGameDirectory()..'/Screenshot.asi', function(id, status) end)
        wait(3000)
    end
    screenshot = require 'screenshot'

    local ip = select(1, sampGetCurrentServerAddress())..':'..select(2, sampGetCurrentServerAddress())
    if ip ~= '176.32.37.62:7777' then
        mainIni.temp.fakenick = false 
        mainIni.temp.nametag = true
        if mainIni.config.onlypp then
            thisScript():unload()
        end
    else
        thispp = true
    end

    for k, v in pairs(mainIni['weapons']) do weapons_list[k] = v end

    for k, v in pairs(mainIni.macrosses) do
        macrosses_list[k] = {}
        for key in tostring(v):gmatch('[^%s?%+]+') do
            table.insert(macrosses_list[k], tonumber(key))
        end
    end

    local f = (not doesFileExist(anonymizer_path) and io.open(anonymizer_path, 'w+') or io.open(anonymizer_path, 'r+'))
    for line in f:lines() do
        table.insert(anonymizer_names, u8:decode(line))
    end
    f:close()

    repeat wait(0) until sampIsLocalPlayerSpawned() and isCharOnScreen(PLAYER_PED)

    if mainIni.config.anonymizer then
        for k, v in pairs(anonymizer_names) do
            local name, mask = v:match('(.+) = (.+)')
            if sampGetPlayerNickname(select(2, sampGetPlayerIdByCharHandle(PLAYER_PED))) == name or sampGetPlayerIdByNickname(name) ~= -1 then
                changeName(name, mask)
            end
        end
    else
        for k, v in pairs(anonymizer_names) do
            local name, mask = v:match('(.+) = (.+)')
            if sampGetPlayerNickname(select(2, sampGetPlayerIdByCharHandle(PLAYER_PED))) == name or sampGetPlayerIdByNickname(mask) ~= -1 then
                changeName(mask, name)
            end
        end
    end

    local list = {
        update_url,
        'https://raw.githubusercontent.com/moreveal/moreveal_hh/main/script/last_news.txt'
    }

    for index, url in pairs(list) do
        httpRequest(url, nil, function(response, code, headers, status)
            if response then
                if index == 1 then
                    new_version, text_new_version = response:match('(%d+) | (.+)')
                    if tonumber(new_version) > script_version then updateScript() update = true end
                elseif index == 2 then
                    changelog = u8:decode(response)
                end
            else
                print(url, 'Ошибка при получении последней версии скрипта', code)
            end
        end)
    end

    lua_thread.create(function ()
        if not update then
            local c_one, c_two = 0, 16777215
            local name = sampGetPlayerNickname(select(2, sampGetPlayerIdByCharHandle(PLAYER_PED)))
            local length = renderGetFontDrawTextLength(font, "Settings: " .. layoutMacrossString('setting')) > renderGetFontDrawTextLength(font, "Hello, " .. name:gsub("_", " ")) + 80 and renderGetFontDrawTextLength(font, "Settings: " .. layoutMacrossString('setting')) or renderGetFontDrawTextLength(font, "Hello, " .. name:gsub("_", " ")) + 80
            local w_one, w_two = renderGetFontDrawHeight(font) + 20, renderGetFontDrawHeight(font)
            local timer = os.clock()

            while os.clock() - timer < 10 do
                wait(0)

