function loadOtstrelList(type)
    otstrel_list = {}
    if mainIni.config.otstrel_type then
        httpRequest('http://pphitman.5nx.org/static.php?p=otstrel&sid=614c63f9d10863cc46796f1397f8a3ff', nil, function(response, code, headers, status)
            for nick in string.gmatch(u8:decode(response):match('<div class="quotecontent">(.+)'), '(%w+_%w+)') do 
                table.insert(otstrel_list, {name = nick})
            end
        end)
        if #otstrel_list == 0 then
            mainIni.config.otstrel_type = false
            cb_otsauto[0], cb_otslocal[0] = false, true
            scriptMessage('Невозможно загрузить список отстрела {CCCCCC}[ Связь с порталом не установлена ]')
            scriptMessage('Режим получения списка будет изменен, а скрипт перезапущен.')
            thisScript():reload()
        end
    else
        if doesFileExist(otstrel_path) then
            local f = io.open(otstrel_path, 'r+')
            for name in f:lines() do table.insert(otstrel_list, {name = name}) end
            f:close()
        end
    end

    if type == 1 and mainIni.config.otstrel then
        local count, count_online = 0, 0
        for k, v in pairs(otstrel_list) do
            count = count + 1
            for s, t in pairs(mainIni.otstrel_list) do 
                if s == v.name then 
                    v.time = t
                    break 
                end 
            end 

            local id = sampGetPlayerIdByNickname(v.name)
            if id ~= -1 then
                count_online = count_online + 1
            end
        end
        scriptMessage('Список отстрела загружен. Игроков в сети: '..count_online)
    end
end

function isKeysDown(key, state)
	if state == nil then
		state = false
	end

	if key[1] == nil then
		return false
	end

	local result = false
	slot4 = #key < 2 and tonumber(key[1]) or tonumber(key[2])

	if #key < 2 then
		if not isKeyDown(VK_RMENU) and not isKeyDown(VK_LMENU) and not isKeyDown(VK_LSHIFT) and not isKeyDown(VK_RSHIFT) and not isKeyDown(VK_LCONTROL) and not isKeyDown(VK_RCONTROL) then
			if wasKeyPressed(slot4) and not state then
				result = true
			elseif isKeyDown(slot4) and state then
				result = true
			end
		end
	elseif isKeyDown(tonumber(key[1])) and not wasKeyReleased(tonumber(key[1])) then
		if wasKeyPressed(slot4) and not state then
			result = true
		elseif isKeyDown(slot4) and state then
			result = true
		end
	end

	if nextLockKey == key then
		if state and not wasKeyReleased(slot4) then
			result = false
		else
			result = false
			nextLockKey = ""
		end
	end

	return result
end

